INSERT INTO `produk` (`id_produk`, `id_kategori`, `nama_produk`, `deskripsi_produk`, `harga`, `sampul`, `nilai_mae`, `created_at`, `updated_at`) VALUES
(20101, 2, '2 Hari 1 Malam [Camping Desa Sembalun]', '<p>Kami menyediakan tour dengan waktu 2 hari 1 malam di daratan tinggi sembalun. Tour ini disajikan untuk anda yang ingin merasakan sensasi camping tapi males mendaki, paket trip ini menjadi solusi yang tepat.</p>\n\n<hr />\n<p><strong>Rencana Perjalanan&nbsp;</strong></p>\n\n<p>Day 1 :</p>\n\n<ul>\n	<li>Penjemputan di meeting point</li>\n	<li>Menuju Desa Sembalun</li>\n	<li>Mendirikan tenda</li>\n	<li>Menikmati suasana malam di camping ground</li>\n	<li>Makan malam</li>\n	<li>Istirahat</li>\n</ul>\n\n<p>Day 2 :</p>\n\n<ul>\n	<li>Bangun lebih pagi</li>\n	<li>Menikmati susana pagi Sembalun</li>\n	<li>Menuju Punck Sembalun</li>\n	<li>Petik strawberry</li>\n	<li>Sarapan di Kedai Sawah</li>\n	<li>Menuju Bukit Selong</li>\n	<li>Pengantaran ke meeting point</li>\n	<li>Sayonara see you next trip</li>\n</ul>\n\n<hr />\n<p>Paket ini memiliki include dan exclude tersendiri.</p>\n\n<p>Include :</p>\n\n<ul>\n	<li>Mobil + Driver</li>\n	<li>Tour Guide</li>\n	<li>Perlengkapan camping</li>\n	<li>Perlengkapan masak</li>\n	<li>Tiket petik strawberry</li>\n	<li>Kopi</li>\n	<li>Tiket masuk wisata</li>\n	<li>Parkir</li>\n</ul>\n\n<p>Exclude :</p>\n\n<ul>\n	<li>Makanan ringan</li>\n	<li>Tipping untuk tour guide</li>\n	<li>Kebutuhan pribadi</li>\n</ul>\n\n<hr />\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\n\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\n', '470000', '62886f682fc2a (1).jpg', 0.635916, '0000-00-00 00:00:00', '2022-12-22 20:34:14'),
(20102, 2, '3 Hari 2 Malam [Explore Gili]', '<p>Kami menyediakan tour dengan waktu 3 hari 2 malam didaerah gili Lombok. JIka anda yang ingin merasakan sensasi pantai, dan laut, paket trip ini menjadi solusi yang tepat.</p>\r\n\r\n<hr />\r\n<p><strong>Rencana Perjalanan :</strong></p>\r\n\r\n<p>Day 1:</p>\r\n\r\n<ul>\r\n	<li>Penjemputan di titik jemput</li>\r\n	<li>Desa Sukarare</li>\r\n	<li>Desa Sade</li>\r\n	<li>Pantai Kuta&nbsp;</li>\r\n	<li>Bukit Merese (Pilihan 1)</li>\r\n	<li>Pantai Tanjung Aan (Pilihan 1)</li>\r\n	<li>Pantai Mawun (Pilihan 2)</li>\r\n	<li>Pantai Selong Belanak (Pilihan2)</li>\r\n</ul>\r\n\r\n<p>Day 2:</p>\r\n\r\n<ul>\r\n	<li>Villa Hantu</li>\r\n	<li>Bukit Malimbu&nbsp;</li>\r\n	<li>Bukit Malaka&nbsp;</li>\r\n	<li>Bukit Kecinan&nbsp;</li>\r\n	<li>Gili Air, Meno, dan Trawangan (Snorkeling)</li>\r\n</ul>\r\n\r\n<p>Day 3:</p>\r\n\r\n<ul>\r\n	<li>Souvenir Center</li>\r\n	<li>Islamic Centre NTB</li>\r\n	<li>Antar ke bandara atau hotel</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Paket ini memiliki include dan exclude tersendiri.</p>\r\n\r\n<p>Include :</p>\r\n\r\n<ul>\r\n	<li>Mobil + Driver</li>\r\n	<li>Tour Guide</li>\r\n	<li>Perlengkapan camping</li>\r\n	<li>Perlengkapan masak</li>\r\n	<li>Tiket petik strawberry</li>\r\n	<li>Kopi</li>\r\n	<li>Tiket masuk wisata</li>\r\n	<li>Parkir</li>\r\n</ul>\r\n\r\n<p>Exclude :</p>\r\n\r\n<ul>\r\n	<li>Makanan ringan</li>\r\n	<li>Tipping untuk tour guide</li>\r\n	<li>Kebutuhan pribadi</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Persediaan:</strong></p>\r\n\r\n<ul>\r\n	<li>Harga sesuai dengan hotel yang dipilih dan harga diatas adalah per orang.</li>\r\n	<li>Harga dapat berubah sewaktu-waktu mengikuti season (LS/HS/PS)</li>\r\n	<li>Ada biaya tambahan untuk upgrade kamar.</li>\r\n	<li>Jika jumlah peserta ganjil, maka 1 peserta akan menggunakan extra bed.<br />\r\n	Contoh :<br />\r\n	3 peserta mendapatkan 1 kamar dengan extra bed<br />\r\n	5 peserta mendapatkan 2 kamar dengan extra bed<br />\r\n	Trip ini bersifat private, tidak digabung dengan peserta lain.<br />\r\n	Bersyarat: rencana perjalanan di atas bersyarat<br />\r\n	Opsional : Pilih tujuan</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Notes:&nbsp;</p>\r\n\r\n<p>Untuk kedatangan sebaiknya menggunakan pesawat pagi sebelum jam 12. Untuk pulang, sebaiknya menggunakan pesawat pagi setelah jam 12. Sebelum melakukan pemesanan, akan lebih baik untuk berkonsultasi dengan admin.</p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '1380000', 'IMG_313.jpeg', 0.5051, '2022-11-15 08:16:53', '2022-12-22 20:34:14'),
(20103, 1, '1 Hari di Gili Kondo', '<p>Kami menyediakan tour dengan waktu singkat didaerah gili Kondo. JIka anda yang ingin merasakan sensasi pantai, dan laut, paket trip ini menjadi solusi yang tepat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>Paket ini memiliki include dan exclude tersendiri.</p>\r\n\r\n<p>Include :</p>\r\n\r\n<ul>\r\n	<li>Mobil + Driver</li>\r\n	<li>Tour Guide</li>\r\n	<li>Tiket masuk wisata</li>\r\n	<li>Parkir</li>\r\n	<li>Penjemputan di Hotel atau Bandara</li>\r\n	<li>Gili kondo Harbor</li>\r\n	<li>Gili Bidara (snorkling)</li>\r\n	<li>Gili Petagan (snorkling)</li>\r\n	<li>Gili Pasir</li>\r\n	<li>Gili Kondo (snorkling)</li>\r\n	<li>Kembali Harbor</li>\r\n	<li>Antar ke Hotel</li>\r\n</ul>\r\n\r\n<p>Exclude :</p>\r\n\r\n<ul>\r\n	<li>Makanan ringan</li>\r\n	<li>Tipping untuk tour guide</li>\r\n	<li>Kebutuhan pribadi</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Persediaan:</strong></p>\r\n\r\n<ul>\r\n	<li>Harga sesuai dengan hotel yang dipilih dan harga diatas adalah per orang.</li>\r\n	<li>Harga dapat berubah sewaktu-waktu mengikuti season (LS/HS/PS)</li>\r\n	<li>Ada biaya tambahan untuk upgrade kamar.</li>\r\n	<li>Jika jumlah peserta ganjil, maka 1 peserta akan menggunakan extra bed.<br />\r\n	Contoh :<br />\r\n	3 peserta mendapatkan 1 kamar dengan extra bed<br />\r\n	5 peserta mendapatkan 2 kamar dengan extra bed<br />\r\n	Trip ini bersifat private, tidak digabung dengan peserta lain.<br />\r\n	Bersyarat: rencana perjalanan di atas bersyarat<br />\r\n	Opsional : Pilih tujuan</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><img alt=\"\" src=\"https://horizontourtravel.com/wp-content/uploads/2022/10/Gili-Kondo-Gili-Bidara-and-Gili-Petagan-Island-Hopping-Trip-from-Lombok.jpg\" style=\"height:158px; width:300px\" />&nbsp;<img alt=\"\" src=\"https://horizontourtravel.com/wp-content/uploads/2022/07/gili-nanggu.jpg\" style=\"height:158px; width:211px\" /></p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '855000', 'gili kondo 1.jpg', 0.494607, '2022-11-15 08:38:15', '2022-12-22 20:34:14'),
(20104, 1, '1 Hari di Mandalika', '<p>Cukup hanya satu hari anda bisa menjelajahi daerah ekonomi khusus mandalika, dengan mengunjungi tempat-tempat yang menjadi favorit wisatawan</p>\r\n\r\n<p>Mandalika merupakan daerah pesisir pulau Lombok, Mandalika menyimpan segudang keindahan alam dengan hamaparan pasir putih yang sangat indah di semua pantainya. Cukup hanya satu hari anda bisa menjelajahi daerah ekonomi khusus mandalika, dengan mengunjungi tempat-tempat yang menjadi favorit wisatawan, seperti pantai Tanjung Aan, Bukit Merese, Pantai Kuta, Bukit Seger,&nbsp; Pantai Selong Belanak, dan tentunya Sirkuit Mandalika. Tidak hanya sampai disitu di paket trip explore mandalika ini kami akan mengajak anda untuk belajar sejarah suku Sasak di desa Sade dan Desa Sukarara.</p>\r\n\r\n<hr />\r\n<p><strong>Rencana Perjalanan:</strong></p>\r\n\r\n<ul>\r\n	<li>Penjemputan bandara/hotel ( max jam 9.00 wita )</li>\r\n	<li>Menuju desa Sukarara&nbsp;</li>\r\n	<li>Makan siang</li>\r\n	<li>Menuju Desa Sade</li>\r\n	<li>Menuju pantai Kuta Mandalika&nbsp;</li>\r\n	<li>Bukit Seger&nbsp;</li>\r\n	<li>Sirkuit Mandalika</li>\r\n	<li>Bukit Merese dan Pantai Tanjung Aan</li>\r\n	<li>Makan malam&nbsp;</li>\r\n	<li>Kembali ke Hotel</li>\r\n	<li>Sayonara see you next trip</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Notes:</strong></p>\r\n\r\n<ul>\r\n	<li>Premium dokumentasi with drone dan kamera DSLR tambahan biaya 600.000*</li>\r\n	<li>Free premium dokumentasi booking diatas 9 paket&nbsp;</li>\r\n	<li>Start trip max jam 9.00 Witan&nbsp;&nbsp;</li>\r\n	<li>Rescedule maksimal&nbsp; konfirmasi H-3 trip*</li>\r\n	<li>Anak &ndash; anak usia di bawah 6 th free&nbsp;</li>\r\n	<li>English tour guide tambahan biaya 450.000*</li>\r\n</ul>\r\n\r\n<p>*Konfirmasi kepada admin melalui whatsapp</p>\r\n\r\n<hr />\r\n<p><img alt=\"\" src=\"https://horizontourtravel.com/wp-content/uploads/2022/07/pantai-Tanjung-Aan.jpg\" style=\"height:158px; width:223px\" />&nbsp;<img alt=\"\" src=\"https://horizontourtravel.com/wp-content/uploads/2022/07/bukit-merese.jpg\" style=\"height:158px; width:281px\" />&nbsp;<img alt=\"\" src=\"https://horizontourtravel.com/wp-content/uploads/2022/07/bukit-merese.jpg\" style=\"height:158px; width:281px\" /></p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '450000', 'Bukit Seger (3).JPG', 0.418382, '2022-11-15 09:07:23', '2022-12-22 20:34:14'),
(20105, 3, 'Trek to Pergasingan Hill[Harian]', '<p>Bukit Pergasingan terletak di desa Sembalun, Lombok Timur, dengan ketinggian 1806 mdpl, bukit Pergasingan menawarkan suasana pendakian yang tidak kalah menyenangkan dari bukit atau gunung lain yang ada di Lombok, dari atas bukit Anda dapat menikmati suasana di atas mendung, melintasi persawahan desa Sembalun dan Gunung Rinjani yang gagah, sunset disini tidak kalah indahnya dengan tempat lain.</p>\r\n\r\n<hr />\r\n<ul>\r\n	<li>Penjemputan &ndash; Desa Sembalun &ndash; Puncak Pergasingan</li>\r\n	<li>Penjemputan Anda di hotel atau pelabuhan/bandara di Lombok pada pukul 6</li>\r\n	<li>Kami mulai trekking maksimal jam 10</li>\r\n	<li>Kami akan mendapatkan puncak setelah 3 jam trekking</li>\r\n	<li>Nikmati waktu di atas sambil makan buah dan minuman segar</li>\r\n	<li>Setelah 1 jam di puncak kemudian bersiap untuk turun ke Desa Sembalun</li>\r\n	<li>Mentransfer Anda ke tujuan berikutnya.</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>HARGA SUDAH TERMASUK HARGA TREKKING RINJANI :</p>\r\n\r\n<ul>\r\n	<li>Menjemput Anda pada hari 0 dan mentransfer Anda setelah perjalanan Selesai,</li>\r\n	<li>Panduan Pendakian</li>\r\n	<li>Buah segar</li>\r\n	<li>Konsumsi air setiap hari dari air minum kemasan yang aman</li>\r\n	<li>Biaya masuk</li>\r\n</ul>\r\n\r\n<p>HARGA TIDAK TERMASUK HARGA TREKKING RINJANI:</p>\r\n\r\n<ul>\r\n	<li>Sepatu trekking</li>\r\n	<li>Makan siang</li>\r\n	<li>Jaket trekking</li>\r\n	<li>Pesawat tiket</li>\r\n	<li>Celana/celana panjang</li>\r\n	<li>Tip untuk guide dan porter</li>\r\n</ul>\r\n\r\n<hr />\r\n<ul>\r\n	<li>Pendakian ini cocok untuk pemula dan anak-anak</li>\r\n	<li>Cocok untuk anda yang tidak lama berada di lombok tapi ingin merasakan pendakian</li>\r\n	<li>Harganya tergantung dimana meeting pointnya</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '998000', 'Salinan-Pergasingan-54.jpg', 0.655837, '2022-11-21 03:53:50', '2022-12-22 20:34:14'),
(20114, 4, 'Trekking Rinjani to Sangkareang[2 hari 1 malam]', '<p>Paket Pendakian Baru Trekking Rinjani ke tepi Kawah Senaru dan Puncak ke-2 gunung sangkareang 3.126 mdpl selama 2 hari 1 malam dimulai dari desa Senaru ke tepi kawah, puncak ke-2 (Gunung Sangkareang) dan kembali ke desa Senaru keesokan harinya.</p>\r\n\r\n<p>Program ini cocok untuk pendaki pemula maupun bagi anda yang ingin menikmati keindahan pemandangan dari bibir kawah Senaru dan 2nd Summit.</p>\r\n\r\n<hr />\r\n<p><strong>Hari Kedatangan :</strong></p>\r\n\r\n<p>Kami akan menjemput Anda di bandara Lombok atau tempat lain di pulau Lombok dan mengantar Anda ke hotel di Senaru. Temui Pemandu trekking Anda akan memberikan panduan untuk lebih mempersiapkan Anda dalam perjalanan.</p>\r\n\r\n<p><strong>Hari Pertama:</strong></p>\r\n\r\n<ul>\r\n	<li>Bangun jam 6:30 pagi dan sarapan. Setelah itu kita jalan kaki 10 menit ke Rinjani Trek Center Senaru untuk registrasi.</li>\r\n	<li>Trekking Rinjani dimulai dari Rinjani Trek Center Senaru sekitar pukul 08:00, mulai berjalan melalui hutan tropis yang lebat kaya akan flora, burung, dan berbagai jenis kupu-kupu. Berhentilah sejenak di Pos 2 Halte SATAS Montong (1.500 m) untuk minum teh dan biskuit. Setelah istirahat lanjutkan trekking selama 2 jam menuju Pos 3 Mondokan Lolak (2.000 m) untuk istirahat dan makan siang.</li>\r\n	<li>Setelah makan siang kita akan langsung meninggalkan Pos 3 dan menuju bibir kawah Senaru (2641m) selama 2 jam. Kawah Senaru memiliki pemandangan paling spektakuler setelah puncaknya. Kita akan menikmati matahari terbenam yang luar biasa di atas Gunung Agung di Bali dan asap dari gunung berapi baru di tepi danau dan berkemah di sini untuk bermalam.</li>\r\n</ul>\r\n\r\n<p><strong>Hari Kedua:</strong></p>\r\n\r\n<ul>\r\n	<li>Bangun jam 4.00 pagi dan setelah sarapan ringan dengan minuman panas dan roti panggang kita akan mendaki ke puncak ke-2 3.12 mdpl. saat Sunrise kita akan tiba di puncak dan menikmati sunrise di atas puncak Gunung Rinjani. Setelah puas menikmati panorama yang indah kita akan kembali ke bumi perkemahan untuk sarapan dan istirahat.</li>\r\n	<li>Setelah sarapan pagi dan istirahat, kita akan meninggalkan Gunung Rinjani untuk turun ke desa Senaru melewati hutan hujan. Jika kita beruntung, kita bisa melihat monyet hitam yang langka. Dibutuhkan 5 jam dan kami akan makan siang di sepanjang jalan. Tiba di desa Senaru (601 m) Mobil akan membawa Anda ke tujuan selanjutnya.</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Harga Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Ambil dan transfer</li>\r\n	<li>Penginapan malam di Senaru</li>\r\n	<li>Pemandu trekking Porter</li>\r\n	<li>Makanan dan minuman,</li>\r\n	<li>Tenda, tenda toilet, kantong tidur, dan kasur</li>\r\n	<li>Biaya masuk taman nasional Rp300.000/trekker/trip (Rp150.000/orang/hari)</li>\r\n	<li>Pertolongan pertama pada kecelakaan</li>\r\n	<li>Asuransi perjalanan masuk</li>\r\n	<li>Menjemput Anda pada hari 0 dan mentransfer Anda setelah perjalanan Selesai,</li>\r\n	<li>Pemandu Trekking Rinjani</li>\r\n	<li>Porter untuk membawa perlengkapan logistik dan trek (tidak termasuk untuk membawa tas pribadi Anda)</li>\r\n	<li>Makan full board selama program perjalanan; sarapan, makan siang, makan malam, kopi atau teh, cokelat panas, makanan ringan, buah-buahan segar</li>\r\n	<li>Semua peralatan berkemah; tenda berkemah ukuran ganda, kasur, kantong tidur, tenda toilet, kursi berkemah.</li>\r\n	<li>Konsumsi air setiap hari dari air minum kemasan yang aman</li>\r\n	<li>Biaya masuk</li>\r\n	<li>Akomodasi malam di senaru atau Sembalun sebelum perjalanan.</li>\r\n</ul>\r\n\r\n<p><br />\r\nHarga Tidak Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Head lamp/obor tangan</li>\r\n	<li>Paket tas kecil / paket harian</li>\r\n	<li>Sepatu trekking</li>\r\n	<li>Jaket trekking</li>\r\n	<li>Pesawat tiket</li>\r\n	<li>Porter tambahan untuk bagasi sendiri (22$/hari)</li>\r\n	<li>Celana/celana panjang</li>\r\n	<li>Tip untuk guide dan porter</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>CATATAN !!</strong><br />\r\nKetika Anda memesan perjalanan Anda melalui Horizon Tour and Travel, Anda akan diberikan Pemandu Gunung Berbahasa Inggris dan porter lokal dan sebagian besar kebutuhan berkemah seperti tenda, kantong tidur, kasur, perlengkapan memasak. dll.</p>\r\n\r\n<p>Namun, pemandu gunung dan porter kami hanya bertugas untuk membawa semua peralatan berkemah (tenda, kantong tidur, matras, dll), peralatan masak dan logistik yang diperlukan selama program (makanan, air, makanan ringan, buah-buahan, minuman ringan, dll) mereka tidak bertanggung jawab untuk membawa barang-barang pribadi Anda.</p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '2100000', 'rinjani.jpg', 0.392703, '2022-12-20 19:40:16', '2022-12-22 20:34:14'),
(20115, 4, 'Trekking Danau Segara Anak [3 hari 1 malam]', '<p><strong>Mulai dari Senaru, berakhir di Desa Torean.</strong></p>\r\n\r\n<p>Rancangan program Summit Rinjani untuk menjelajahi semua sisi gunung Rinjani dari jalur trekking Senaru dan kembali melalui jalur trekking Torean. Program Rinjani 3 hari akan memberi Anda pengalaman trekking dan perjalanan petualangan terbaik.</p>\r\n\r\n<hr />\r\n<p><strong>Day 1&nbsp;Senaru Village &ndash; Senaru Crater Rim (2,641 m) :</strong></p>\r\n\r\n<ul>\r\n	<li>Pendakian dimulai pukul 07:30-08:00 setelah terdaftar di Rinjani Trekking Center.</li>\r\n	<li>Dalam 30 menit pertama kita akan berjalan di jalan terbuka perkebunan kopi, bambu, dan masih banyak lagi perkebunan milik masyarakat lokal di desa Senaru.</li>\r\n	<li>Kita akan istirahat sejenak 10-15 menit begitu sampai di gerbang hutan hujan tropis.</li>\r\n	<li>Kemudian kita bisa melanjutkan trekking melalui hutan dimana kita akan berjalan di suhu yang lembab dan terlindung dari sinar matahari.</li>\r\n	<li>Anda akan menemukan banyak pohon besar dan suara binatang seperti dari monyet hitam atau coklat.</li>\r\n	<li>Ini bisa memakan waktu hingga 3 jam berjalan kaki untuk mencapai POS-2 MONTONG SATAS (1.500 m) di mana kita bisa istirahat dan istirahat lagi.</li>\r\n	<li>Anda akan disajikan dengan minuman ringan, kerupuk, dan buah-buahan segar seperti pisang atau nanas.</li>\r\n	<li>Setelah istirahat Anda akan membutuhkan 2 jam lagi trekking terbuka melewati perkebunan stroberi untuk mencapai POS-3 MONDOKAN LOKAK (2.000 m).</li>\r\n	<li>Kami akan makan siang di sini termasuk makanan ringan dan buah-buahan segar.</li>\r\n	<li>Ketahuilah bahwa di sini Anda dapat menemukan banyak monyet coklat yang dapat mencuri barang-barang kecil Anda tanpa pengawasan.</li>\r\n	<li>Setelah makan siang kita akan melanjutkan trekking dari hutan hujan tropis menuju savana dengan pemandangan yang sangat indah.</li>\r\n	<li>Beristirahat sejenak di CEMARA LIMA kemudian melanjutkan trekking ke Pelawangan 1, Lingkar Kawah Senaru (2.641 m) selama sekitar satu jam dengan jalan berbatu dan cukup terjal.</li>\r\n	<li>Kami akan mendirikan kemah dan bermalam dengan makan malam yang disediakan.</li>\r\n	<li>Anda akan mendapatkan pemandangan dan momen yang menakjubkan sebagai berikut:\r\n	<ul>\r\n		<li>Matahari terbenam yang spektakuler di atas 3 Gili (pulau kecil) dan Gunung Agung di Bali.</li>\r\n		<li>Matahari terbit dari lembah Gunung Sanggka Reyang.</li>\r\n		<li>Asap keluar dari gunung berapi baru di tengah danau Segara Anak.</li>\r\n		<li>Puncak Gunung Rinjani.</li>\r\n		<li>Tidur nyenyak di bawah bintang-bintang.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Day 2:</strong></p>\r\n\r\n<ul>\r\n	<li>Setelah sarapan pagi dan menikmati sunrise, kita akan turun ke danau Segara Anak, waktu tempuh kurang lebih 2 jam.</li>\r\n	<li>Rutenya cukup curam dan licin, Anda harus berhati-hati dan mengikuti instruksi dari pemandu trekking Anda dan tetap dekat dengan dia atau porter.</li>\r\n	<li>Anda akan menemukan pemandangan indah dari gunung berapi kecil yang terletak di depan pandangan Anda.</li>\r\n	<li>Anda bisa bersantai dan beristirahat ketika sudah sampai di danau Segara Anak dengan pemandian air panas hanya 10 menit berjalan kaki dari danau.</li>\r\n	<li>Air dari sumber air panas ini mengandung Belerang yang dipercaya dapat menyembuhkan berbagai penyakit kulit.</li>\r\n	<li>Makan siang akan disediakan di samping danau Segara Anak.</li>\r\n	<li>Setelah makan siang dan istirahat, Anda bisa berenang atau memancing bersama penduduk setempat.</li>\r\n	<li>Makan malam akan disediakan di sini dan kita akan menginap.</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Day 3:</strong></p>\r\n\r\n<ul>\r\n	<li>Setelah sarapan pagi jam 07.30-08.00 kita akan meninggalkan danau menuju Torean Crater Rim.</li>\r\n	<li>Sekitar 400 meter Anda akan menemukan sebuah gua (GOA SUSU) dengan mata air panas di dalamnya</li>\r\n	<li>Makan siang akan diselenggarakan di POS-2 CEMARA NUMGGAL.</li>\r\n	<li>Setelah makan siang dan istirahat sejenak kemudian kita akan kembali turun ke desa Torean dengan perkiraan kedatangan pada pukul 17:00-18:00</li>\r\n	<li>Anda berjalan menyusuri sungai yang indah, rumput sabana, hutan tropis, dan Anda akan menabrak air terjun yang indah (air terjun Penimbungan)</li>\r\n	<li>Mobil kami akan siap mengantarkan Anda untuk mengambil sisa barang bawaan Anda dan pergi ke bandara atau tujuan Anda selanjutnya di pulau Lombok.</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Harga Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Ambil dan transfer</li>\r\n	<li>Penginapan malam di Senaru</li>\r\n	<li>Pemandu trekking Porter</li>\r\n	<li>Makanan dan minuman,</li>\r\n	<li>Tenda, tenda toilet, kantong tidur, dan kasur</li>\r\n	<li>Biaya masuk taman nasional Rp300.000/trekker/trip (Rp150.000/orang/hari)</li>\r\n	<li>Pertolongan pertama pada kecelakaan</li>\r\n	<li>Asuransi perjalanan masuk</li>\r\n	<li>Menjemput Anda pada hari 0 dan mentransfer Anda setelah perjalanan Selesai,</li>\r\n	<li>Pemandu Trekking Rinjani</li>\r\n	<li>Porter untuk membawa perlengkapan logistik dan trek (tidak termasuk untuk membawa tas pribadi Anda)</li>\r\n	<li>Makan full board selama program perjalanan; sarapan, makan siang, makan malam, kopi atau teh, cokelat panas, makanan ringan, buah-buahan segar</li>\r\n	<li>Semua peralatan berkemah; tenda berkemah ukuran ganda, kasur, kantong tidur, tenda toilet, kursi berkemah.</li>\r\n	<li>Konsumsi air setiap hari dari air minum kemasan yang aman</li>\r\n	<li>Biaya masuk</li>\r\n	<li>Akomodasi malam di senaru atau Sembalun sebelum perjalanan.</li>\r\n</ul>\r\n\r\n<p><br />\r\nHarga Tidak Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Head lamp/obor tangan</li>\r\n	<li>Paket tas kecil / paket harian</li>\r\n	<li>Sepatu trekking</li>\r\n	<li>Jaket trekking</li>\r\n	<li>Pesawat tiket</li>\r\n	<li>Porter tambahan untuk bagasi sendiri (22$/hari)</li>\r\n	<li>Celana/celana panjang</li>\r\n	<li>Tip untuk guide dan porter</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>CATATAN !!</strong><br />\r\nKetika Anda memesan perjalanan Anda melalui Horizon Tour and Travel, Anda akan diberikan Pemandu Gunung Berbahasa Inggris dan porter lokal dan sebagian besar kebutuhan berkemah seperti tenda, kantong tidur, kasur, perlengkapan memasak. dll.</p>\r\n\r\n<p>Namun, pemandu gunung dan porter kami hanya bertugas untuk membawa semua peralatan berkemah (tenda, kantong tidur, matras, dll), peralatan masak dan logistik yang diperlukan selama program (makanan, air, makanan ringan, buah-buahan, minuman ringan, dll) mereka tidak bertanggung jawab untuk membawa barang-barang pribadi Anda.</p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '2800000', 'shutterstock_162563039.jpg', 0.404704, '2022-12-20 19:57:18', '2022-12-22 20:34:14'),
(20117, 4, 'Trekking Kawah Senaru [2 hari 1 malam]', '<p>Program trekking menarik bagi mereka yang memiliki waktu singkat, ini memberikan pemandangan Danau Segara Anak yang spektakuler di dalam kawah gunung berapi. Trekking ini tersedia untuk anak-anak minimal 7 tahun. Tur dapat berangkat setiap hari kecuali kondisi cuaca tidak memungkinkan.</p>\r\n\r\n<hr />\r\n<p><strong>Ikhtisar Pendakian:</strong></p>\r\n\r\n<p>Lewati hutan tropis yang megah (pohon besar dan trawberry lokal), jalur bayangan.<br />\r\nNikmati suasana hutan dengan suara burung, binatang buas (monyet hitam, monyet coklat, dll).<br />\r\nPemandangan spektakuler dari Gili, desa Senaru dan hutan tropis hijau dari Cemara Lima.<br />\r\nDanau Segara Anak yang unik dan air panas.<br />\r\nPemandangan menakjubkan dari kawah RIM Senaru di atas pemandangan Segara Anak (Sunset dan Sunrise).</p>\r\n\r\n<hr />\r\n<p><strong>Day 1:</strong></p>\r\n\r\n<ul>\r\n	<li>Makan pagi di perkemahan kami ( Horizon Tour and Travel )</li>\r\n	<li>Pendaftaran di RTC ( Rinjani Trekking Center Senaru 601m )</li>\r\n	<li>Persiapan trekking pada pukul 07.30 &ndash; 08.00</li>\r\n	<li>Berjalan di pemandangan terbuka 30 menit dengan tanaman hijau pohon kopi, Bambu, dll</li>\r\n	<li>Lewat jalan kaki 30 menit lagi menuju gerbang hutan hujan tropis, istirahat sejenak 15 menit</li>\r\n	<li>Lanjutkan berjalan melalui hutan di mana kita akan dibayangi matahari 3 jam ke POS 2 ( MONTONG SATAS 1.500m ), terlihat Monyet hitam dan pohon besar di jalan setapak.</li>\r\n	<li>Istirahat di POS 2, siapkan buah-buahan segar dan minuman ringan oleh Guide dan porter kami</li>\r\n	<li>Lanjut ke POS 3 ( MONDOKAN LOLAK 2.000m ) melewati hutan tropis, trawbery lokal ( Juni, Juli, Agustus ), jalan kaki 3 jam, makan siang akan disiapkan di POS 3 ( Buah segar, snack / biskuit dan makan siang )</li>\r\n	<li>Setelah 1 jam 30 menit istirahat, lanjut ke Lingkar Kawah Senaru ( 2.641m ) jalan kaki satu jam</li>\r\n	<li>Berkemah dan bermalam di kawah RIM Senaru, nikmati matahari terbenam yang menakjubkan di atas 3 Gili dan Gunung Agung Bali</li>\r\n</ul>\r\n\r\n<p><strong>Day 2:</strong></p>\r\n\r\n<ul>\r\n	<li>Sarapan dan menikmati matahari terbit dengan pemandangan Danau Segara Anak yang indah</li>\r\n	<li>Berjalan kaki ke desa Senaru selama 4-5 jam</li>\r\n	<li>Akan tiba di desa Senaru sekitar pukul 13.00</li>\r\n	<li>Persiapkan barang bawaan Anda, lalu transfer ke tujuan Anda selanjutnya (pelabuhan Senggigi, Mataram atau Bangsal)</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Harga Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Ambil dan transfer</li>\r\n	<li>Penginapan malam di Senaru</li>\r\n	<li>Pemandu trekking Porter</li>\r\n	<li>Makanan dan minuman,</li>\r\n	<li>Tenda, tenda toilet, kantong tidur, dan kasur</li>\r\n	<li>Biaya masuk taman nasional Rp300.000/trekker/trip (Rp150.000/orang/hari)</li>\r\n	<li>Pertolongan pertama pada kecelakaan</li>\r\n	<li>Asuransi perjalanan masuk</li>\r\n	<li>Menjemput Anda pada hari 0 dan mentransfer Anda setelah perjalanan Selesai,</li>\r\n	<li>Pemandu Trekking Rinjani</li>\r\n	<li>Porter untuk membawa perlengkapan logistik dan trek (tidak termasuk untuk membawa tas pribadi Anda)</li>\r\n	<li>Makan full board selama program perjalanan; sarapan, makan siang, makan malam, kopi atau teh, cokelat panas, makanan ringan, buah-buahan segar</li>\r\n	<li>Semua peralatan berkemah; tenda berkemah ukuran ganda, kasur, kantong tidur, tenda toilet, kursi berkemah.</li>\r\n	<li>Konsumsi air setiap hari dari air minum kemasan yang aman</li>\r\n	<li>Biaya masuk</li>\r\n	<li>Akomodasi malam di senaru atau Sembalun sebelum perjalanan.</li>\r\n</ul>\r\n\r\n<p><br />\r\nHarga Tidak Termasuk:</p>\r\n\r\n<ul>\r\n	<li>Head lamp/obor tangan</li>\r\n	<li>Paket tas kecil / paket harian</li>\r\n	<li>Sepatu trekking</li>\r\n	<li>Jaket trekking</li>\r\n	<li>Pesawat tiket</li>\r\n	<li>Porter tambahan untuk bagasi sendiri (22$/hari)</li>\r\n	<li>Celana/celana panjang</li>\r\n	<li>Tip untuk guide dan porter</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>CATATAN !!</strong><br />\r\nKetika Anda memesan perjalanan Anda melalui Horizon Tour and Travel, Anda akan diberikan Pemandu Gunung Berbahasa Inggris dan porter lokal dan sebagian besar kebutuhan berkemah seperti tenda, kantong tidur, kasur, perlengkapan memasak. dll.</p>\r\n\r\n<p>Namun, pemandu gunung dan porter kami hanya bertugas untuk membawa semua peralatan berkemah (tenda, kantong tidur, matras, dll), peralatan masak dan logistik yang diperlukan selama program (makanan, air, makanan ringan, buah-buahan, minuman ringan, dll) mereka tidak bertanggung jawab untuk membawa barang-barang pribadi Anda.</p>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '2340000', 'senaru-crater-rim-1_1.jpg', 0.507418, '2022-12-20 20:16:11', '2022-12-22 20:34:14'),
(20118, 1, 'Eksplor Gili Trawangan [1 Hari]', '<p>Jika anda ingin menikmati 1 hari anda di lombok,&nbsp;paket trip ini menjadi solusi yang tepat karena menawarkan daerah khas lombok yaitu gili trawangan.</p>\r\n\r\n<hr />\r\n<p>Rencana Perjalanan:</p>\r\n\r\n<ul>\r\n	<li>Jemput di Hotel</li>\r\n	<li>Vila Hantu</li>\r\n	<li>Bukit Malimbu</li>\r\n	<li>Bukit Malaka</li>\r\n	<li>Gili Air (Snorkling)</li>\r\n	<li>Gili Meno (Snorkling)</li>\r\n	<li>Gili Trawangan (Snorkling + Mampir)</li>\r\n	<li>Transfer ke Hotel</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Paket ini memiliki include dan exclude tersendiri.</p>\r\n\r\n<p>Include :</p>\r\n\r\n<ul>\r\n	<li>Mobil + Driver</li>\r\n	<li>Tour Guide</li>\r\n	<li>Tiket masuk wisata</li>\r\n	<li>Parkir</li>\r\n	<li>Penjemputan di Hotel atau Bandara</li>\r\n	<li>Gili kondo Harbor</li>\r\n	<li>Gili Bidara (snorkling)</li>\r\n	<li>Gili Petagan (snorkling)</li>\r\n	<li>Gili Pasir</li>\r\n	<li>Gili Kondo (snorkling)</li>\r\n	<li>Kembali Harbor</li>\r\n	<li>Antar ke Hotel</li>\r\n</ul>\r\n\r\n<p>Exclude :</p>\r\n\r\n<ul>\r\n	<li>Makanan ringan</li>\r\n	<li>Tipping untuk tour guide</li>\r\n	<li>Kebutuhan pribadi</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Persediaan:</strong></p>\r\n\r\n<ul>\r\n	<li>Harga sesuai dengan hotel yang dipilih dan harga diatas adalah per orang.</li>\r\n	<li>Harga dapat berubah sewaktu-waktu mengikuti season (LS/HS/PS)</li>\r\n	<li>Ada biaya tambahan untuk upgrade kamar.</li>\r\n	<li>Jika jumlah peserta ganjil, maka 1 peserta akan menggunakan extra bed.<br />\r\n	Contoh :<br />\r\n	3 peserta mendapatkan 1 kamar dengan extra bed<br />\r\n	5 peserta mendapatkan 2 kamar dengan extra bed<br />\r\n	Trip ini bersifat private, tidak digabung dengan peserta lain.<br />\r\n	Bersyarat: rencana perjalanan di atas bersyarat<br />\r\n	Opsional : Pilih tujuan</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>Silahkan pesan paket tour mu sekarang dengan cara login terlebih dahulu kemudian isi form order yang ada di samping kanan.&nbsp;</p>\r\n\r\n<p>Jika ada pertanyaan, hubungi kami melalui WhatsApp kami yang berada di pojok kanan bawah.</p>\r\n', '600000', 'DJI_0333-scaled.jpg', 0.716589, '2022-12-20 20:20:02', '2022-12-22 20:34:14');
